import Login from "./pages/login";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
   <Router>
        <Switch>
        <Route path="/usuario">
            <Usuario />
          </Route>
        <Route path="/administrativo">
            <Administrativo />
          </Route>
          <Route path="/">
            <Login />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
